import React from "react"
import { Route} from 'react-router-dom';
import Forms from "./forms"

function App(){

    const Goto = function (){
                <Route path='/forms' exact component = {Forms} />
    }
    return(
        <div>
            <button onClick={Goto}>Enter the Data</button>
        </div>
    )
}

export default App
